func TestWFPState(t *testing.T) {
	t.Parallel()

	w, err := parseWFPState(wfpTestData)
	if err != nil {
		t.Fatal(err)
	}

	output := w.simplified().AsTable()
	fmt.Println(output)

	outputLines := strings.Count(output, "\n")
	if outputLines != 10 {
		t.Errorf("Expected 10 output lines, not %d", outputLines)
	}
}

